import React from "react";
import Navbar from "../Components/Navbar";
import Card from "../Components/Card";
import product1 from "../Assets/product1.png";
import product2 from "../Assets/product2.png";
import product3 from "../Assets/product3.webp";

function wcard(val,){

}



const Collections = () => {
  return (
    <>
      <Navbar />
      <h1 className="text-center my-5"> Our Collections </h1>
      <div className="container">
        <div className="row">
          <Card
            imgsrc={product1}
            title="Reprizo Gold Dial Watch"
            price="$ 500.00"
          />
          <Card
            imgsrc={product2}
            title="Fastrack Men's Watch"
            price="$ 450.00"
          />
          <Card
            imgsrc={product3}
            title="Reprizo Black Dial Watch"
            price="$ 480.00"
          />
        </div>
        <div className="row">


        </div>
      </div>
    </>
  );
};

export default Collections;
